<script>
	import AcademSwiper from "@/components/academ/academ-swiper";
	import { mapState } from "vuex";

	export default {
		name: "TheApartments",
		components: { AcademSwiper },
		data: () => ({ bodyWidth: document.body.clientWidth, tab: 1 }),
		computed: {
			...mapState({
				single_room: (state) => state.academ.single_room,
				two_room: (state) => state.academ.two_room,
				three_room: (state) => state.academ.three_room,
			}),
		},
		methods: {
			//* выбор вкладки с  группами квартир
			showApartments(option) {
				switch (option) {
					case 1: {
						this.tab = 1;
						this.selectApartments(1);
						break;
					}
					case 2: {
						this.tab = 2;
						this.selectApartments(2);
						break;
					}
					case 3: {
						this.tab = 3;
						this.selectApartments(3);
						break;
					}
				}
			},

			//* показ квартир по группам (1-комн, 2-комн, 3-комн...)
			selectApartments(numberOfRooms) {
				const apartments = document.querySelectorAll(".apartment");
				apartments.forEach((apartment) => {
					apartment.classList.remove("selected");
				});

				switch (numberOfRooms) {
					case 1: {
						const apartments = document.querySelectorAll(
							".apartments__single-room"
						);
						apartments.forEach((apartment) => {
							apartment.classList.add("selected");
						});
						break;
					}
					case 2: {
						const apartments = document.querySelectorAll(
							".apartments__two-room"
						);
						apartments.forEach((apartment) => {
							apartment.classList.add("selected");
						});
						break;
					}
					case 3: {
						const apartments = document.querySelectorAll(
							".apartments__three-room"
						);
						apartments.forEach((apartment) => {
							apartment.classList.add("selected");
						});
						break;
					}
					default: {
						break;
					}
				}
			},

			//*подсветка на общей схеме квартиры при наведении на квартиру из списка выше
			selectApartment(numberOfRooms) {
				switch (numberOfRooms) {
					case 1: {
						const slide = document.querySelector(".slide__single");
						const nav = slide.querySelectorAll(".slide__item");
						nav.forEach((elementNav) => {
							elementNav.addEventListener("mouseover", () => {
								if (nav[0] == elementNav) {
									document
										.querySelector(".single-room2")
										.classList.add("selected-one");
								}
								if (nav[1] == elementNav) {
									document
										.querySelector(".single-room1")
										.classList.add("selected-one");
								}
								if (nav[2] == elementNav) {
									document
										.querySelector(".single-room4")
										.classList.add("selected-one");
								}
								if (nav[3] == elementNav) {
									document
										.querySelector(".single-room3")
										.classList.add("selected-one");
								}
								if (nav[4] == elementNav) {
									document
										.querySelector(".single-room5")
										.classList.add("selected-one");
								}
								if (nav[5] == elementNav) {
									document
										.querySelector(".single-room6")
										.classList.add("selected-one");
								}
								if (nav[6] == elementNav) {
									document
										.querySelector(".single-room7")
										.classList.add("selected-one");
								}
								if (nav[7] == elementNav) {
									document
										.querySelector(".single-room8")
										.classList.add("selected-one");
								}
								if (nav[8] == elementNav) {
									document
										.querySelector(".single-room9")
										.classList.add("selected-one");
								}
							});
							elementNav.addEventListener("mouseout", () => {
								const apartments =
									document.querySelectorAll(".apartment");
								apartments.forEach((apartment) => {
									apartment.classList.remove("selected-one");
								});
							});
						});
						break;
					}
					case 2: {
						const slide = document.querySelector(".slide__two");
						const nav = slide.querySelectorAll(".slide__item");
						nav.forEach((elementNav) => {
							elementNav.addEventListener("mouseover", () => {
								if (nav[0] == elementNav) {
									document
										.querySelector(".two-room2")
										.classList.add("selected-two");
								}
								if (nav[1] == elementNav) {
									document
										.querySelector(".two-room1")
										.classList.add("selected-two");
								}
								if (nav[2] == elementNav) {
									document
										.querySelector(".two-room4")
										.classList.add("selected-two");
								}
								if (nav[3] == elementNav) {
									document
										.querySelector(".two-room3")
										.classList.add("selected-two");
								}
								if (nav[4] == elementNav) {
									document
										.querySelector(".two-room5")
										.classList.add("selected-two");
								}
								if (nav[5] == elementNav) {
									document
										.querySelector(".two-room6")
										.classList.add("selected-two");
								}
							});
							elementNav.addEventListener("mouseout", () => {
								const apartments =
									document.querySelectorAll(".apartment");
								apartments.forEach((apartment) => {
									apartment.classList.remove("selected-two");
								});
							});
						});
						break;
					}
					case 3: {
						const slide = document.querySelector(".slide__three");
						const nav = slide.querySelectorAll(".slide__item");
						nav.forEach((elementNav) => {
							elementNav.addEventListener("mouseover", () => {
								if (nav[0] == elementNav) {
									document
										.querySelector(".three-room2")
										.classList.add("selected-three");
								}
								if (nav[1] == elementNav) {
									document
										.querySelector(".three-room3")
										.classList.add("selected-three");
								}
								if (nav[2] == elementNav) {
									document
										.querySelector(".three-room1")
										.classList.add("selected-three");
								}
							});
							elementNav.addEventListener("mouseout", () => {
								const apartments =
									document.querySelectorAll(".apartment");
								apartments.forEach((apartment) => {
									apartment.classList.remove(
										"selected-three"
									);
								});
							});
						});
						break;
					}
				}
			},

			//* функция подробного просмотра квартиры (popup)
			openApartment(img) {
				const popup = document.querySelector(".popup");
				const popupImage = popup.querySelector(".popup__image");

				document.querySelector("body").classList.add("locked");
				popup.classList.add("open");
				popupImage.setAttribute("src", `${img}`);
			},

			openApartmentFromSlider() {
				const sliderItems = document.querySelectorAll(
					".swiper-slide-content"
				);
				sliderItems.forEach((sliderItem) => {
					sliderItem.addEventListener("click", () => {
						const img = sliderItem.querySelector("img");
						this.openApartment(img.getAttribute("src"));
					});
				});
			},

			//*проверка ширины экрана
			checkPageWidth() {
				window.addEventListener("resize", () => {
					this.bodyWidth = document.body.clientWidth;
				});
			},
		},
		mounted() {
			this.showApartments(1);

			const interval = setInterval(() => {
				if (this.single_room.length > 0) {
					this.selectApartment(1);
					this.selectApartment(2);
					this.selectApartment(3);
					this.openApartmentFromSlider();
					clearInterval(interval);
				}
			}, 100);
			this.checkPageWidth();
		},
	};
</script>

<style lang="scss" scoped>
