			width: 15rem;
			height: 15rem;
			transform: translateX(55%);

			.radio__real {
				display: none;

				&:checked + .radio__fake {
					font-weight: 300;
					border-width: 0.3rem;
				}
			}

			.radio__fake {
				cursor: pointer;
				text-align: right;
				padding-right: 0.5rem;
				padding-bottom: 1rem;
				display: block;
				width: 100%;
				height: 100%;
				color: $gold;
				font-size: 12rem;
				font-weight: 100;
				border: 0.2rem solid $gold;
				border-radius: 0 0 0 100%;

				&:hover {
					border-width: 0.3rem;
					font-weight: 300;
				}
			}
		}

		&__item + &__item {
			margin-top: 7rem;
		}

		&__schematics {
			position: relative;

			.slide {
				width: 100%;
				max-height: 14rem;
				display: flex;
				gap: 1rem;
				position: absolute;
				top: 0;
				transition: all 0.4s ease;
				overflow-x: auto;
				z-index: 2;

				-ms-overflow-style: none;
				scrollbar-width: none;

				&::-webkit-scrollbar {
					display: none;
				}

				&__item {
					cursor: pointer;
					height: 10rem;
					max-width: 14rem;
					min-width: 5rem;
					width: fit-content;
					img {
